1.  **Fairness:** People care about fairness. The responder compares the offer to what they perceive as a fair split. This perception of fairness may be influenced by their own contribution relative to the proposer's.
2.  **Self-interest:** People also want to maximize their own payoff. Even if the offer is somewhat unfair, they might still accept it if it's a significant amount of money.
3.  **Inequity aversion:** This is a specific type of fairness consideration. People might be willing to sacrifice their own payoff to punish unfair behavior, especially when they perceive the proposer is getting a much larger share.
4.  **Contribution Based Fairness:** How much the participant and opponent contributed in the pre-task influences how fair the decision is.

